y_section_content_1:"BNB48 Club® actively participates in node construction in Binance Smart Chain (BSC) and Cosmos ecosystems. The BNB48 node is currently Kava’s 21st largest node, and the club has future plans to build and run nodes on BSC, the Swingby network, and more.",home_page_activity_section_title_2:"BNB48 Club® Treasury",home_page_activity_section_content_2:"The club maintains a treasury fund to finance its daily operations and projects. These projects include angel investments, project incubation, yield farming, secondary market operations, and more. Club members receive regular updates on the Treasury’s status and asset details.",home_page_introduction_section_title:"Koge - BNB48 Club®’s Native Governance Token and the Core of its Ecosystem",home_page_introduction_section_subtitle:"Koge is a token minted and issued by BNB48 Club®. It represents the voting power to participate in BNB48 Club®’s open governance. The club’s dividends are also paid out to members in Koge tokens.",home_page_partner_section_subtitle:"Strategic Partners",governance_page_banner_section_title_1:"The Club Council is the executive branch of BNB48 Club® overseeing all club operations, and is fully accountable to all Koge holders.",governance_page_banner_section_title_2:"In BNB48’s governance structure, Koge holders submit proposals and these proposals are publicly voted on by club members. The quorum is 5% of all Koge tokens, i.e. a proposal will go through the voting process if over 5% of all Koge tokens support it.",governance_page_banner_section_title_3:"Simple majority vote is the voting method of choice. 1 Koge equates to 1 vote and there are 4 voting options for each Koge token when casting its vote: Yes, No, NoWithVeto, and Abstain. The proposal passes if the all of the following requirements are met:",governance_page_banner_section_title_3_item_1:"· The number of valid votes exceed 20% of the total Koge token supply%",governance_page_banner_section_title_3_item_2:"· The number of Yes votes exceeds the number of No votes",governance_page_banner_section_title_3_item_3:"· The number of NoWithVeto votes does not exceed 1/3rd of the number of valid votes",governance_page_case_section_title_1:"Off-Chain Governance",governance_page_case_section_content_1:"Before the full implementation of on-chain governance on BSC, BNB48 Club® provides a tentative off-chain governance mechanism via Telegram bots.",governance_page_case_section_title_2:"On-Chain Governance",governance_page_case_section_content_2:"BNB48 Club® aims to implement on-chain governance on BSC.",governance_page_case_section_title_3:"Club Committee",governance_page_case_section_content_3:"The Club Committee answers to the Koge community. The addition and removal of councilors are subject to proposals and voting.",governance_page_review_section_title:"Club Committee",governance_page_review_section_subtitle:"Contact List",app_header_menu_home_title:"Home",app_header_menu_governance_title:"Governance",app_header_menu_node_title:"Nodes",app_header_menu_milestone_title:"Milestones",app_header_menu_whitepaper_title:"Whitepaper",app_footer_wechat_section_title:"WeChat",app_footer_social_section_title:"Follow BNB48",app_footer_website_section_title:"Website",app_footer_item_weibo:"Sina Weibo",app_footer_item_wechat_title_1:"BNB48 数字资产理财",app_footer_item_wechat_subtitle_1:"讨论币安宝、存币生息、质押借币、LaunchPad、投票上币等",app_footer_item_wechat_title_2:"BNB48 开仓发财",app_footer_item_wechat_subtitle_2:"讨论现货/衍生品交易，参加交易活动等",app_footer_item_wechat_title_3:"BNB48 场外C2C",app_footer_item_wechat_subtitle_3:"讨论法币交易、C2C交易等。有币安C2C商户入驻",app_footer_item_wechat_title_4:"BNB48 币安智能链",app_footer_item_wechat_subtitle_4:"讨论币安智能链治理节点运维、BNB 质押、智能合约开发与迁移等",app_footer_item_wechat_title_5:"BNB48 Kava 治理节点",app_footer_item_wechat_subtitle_5:"讨论BNB48Club Kava 治理节点、质押及与Kava相关的其他话题",app_footer_copyright:"Rights Reserved © 2020 BNB48Club",app_footer_website_info_security:"Secured by SSL",list_load_more_card_title:"Load More",validation_messa