le_2:"BNB48是BNB的社区成员，币安是BNB的发行者。两者不具有任何意义上的从属关系。",home_page_banner_section_whitepaper_button_title:"Koge 白皮书",home_page_activity_section_title:"BNB48 Club®的主要活动",home_page_activity_section_title_1:"节点建设",home_page_activity_section_content_1:"BNB48 Club®会积极参与币安智能链生态/Cosmos生态的节点建设，目前BNB48已经是Kava的第21大节点，未来计划竞选币安智能链（BSC）节点，SwingBy节点等等。",home_page_activity_section_title_2:"BNB48 Club® Treasury",home_page_activity_section_content_2:"BNB48 Club® Treasury 除维护BNB48 Club的日常运营开支外，也进行关于币安链生态 项目的天使投资、孵化，以及参与BNB生态Yield Farming、二级市场项目等。俱乐部Treasury定期向俱乐部成员公布资产明细。",home_page_introduction_section_title:"Koge，BNB48 Club®的治理代币和生态核心",home_page_introduction_section_subtitle:"Koge，是BNB48 Club®发行的Token，代表参与BNB48 Club®治理的权力，也是BNB48 Club®的准入凭据，同时捕获了BNB48 Club®的盈利。",home_page_partner_section_subtitle:"合作伙伴",governance_page_banner_section_title_1:"理事会获Koge全体持有者授权执行BNB48 Club®的日常事务，对全体Koge持有者负责。",governance_page_banner_section_title_2:"Koge持有者发起提案、公开投票表决是俱乐部的根本权力形式。超过总量5%的Koge持有者联署，发起提案即视为有效。",governance_page_banner_section_title_3:"投票通常拥有赞成、反对、弃权、否决四个选项。每项表决结果遵循简单多数原则，1 Koge 1 票，同时满足以下条件即表决通过。",governance_page_banner_section_title_3_item_1:"· 有效投票数超过Koge总量的20%",governance_page_banner_section_title_3_item_2:"· 赞成票数超过反对票数",governance_page_banner_section_title_3_item_3:"· 否决票不超过有效投票数的1/3",governance_page_case_section_title_1:"链下治理",governance_page_case_section_content_1:"在完整的链上治理功能在币安智能链上线之前，BNB48 Club®将采用链下治理的方式 - 通过Telegram机器人（链接）进行治理。",governance_page_case_section_title_2:"链上治理",governance_page_case_section_content_2:"BNB48 Club®将在币安智能链（BSC）上持续探索和开发链上治理功能。",governance_page_case_section_title_3:"理事会",governance_page_case_section_content_3:"理事会获Koge全体持有者授权执行俱乐部日常事务，对全体Koge持有者负责。新增理事提案表决通过产生新理事，罢免理事提案表决通过罢免现有理事。",governance_page_review_section_title:"理事会",governance_page_review_section_subtitle:"名单及联系方式",app_header_menu_home_title:"主页",app_header_menu_governance_title:"治理",app_header_menu_node_title:"节点",app_header_menu_milestone_title:"大事记",app_header_menu_whitepaper_title:"白皮书",app_footer_wecha